import React, { useEffect, useState } from 'react';
import { Box, Typography, Button, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, CircularProgress } from '@mui/material';
import ProductosService from '../services/ProductosService';

function ProductosPage() {
  const [productos, setProductos] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    ProductosService.getAll().then(data => {
      setProductos(data.productos || []);
      setLoading(false);
    });
  }, []);

  return (
    <Box p={3}>
      <Typography variant="h4" mb={2}>Productos</Typography>
      {loading ? <CircularProgress /> : (
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>ID</TableCell>
                <TableCell>Nombre</TableCell>
                <TableCell>Descripción</TableCell>
                <TableCell>Precio Compra</TableCell>
                <TableCell>Precio Venta</TableCell>
                <TableCell>Stock Actual</TableCell>
                <TableCell>Stock Mínimo</TableCell>
                <TableCell>Categoría</TableCell>
                <TableCell>Proveedor</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {productos.map((p, idx) => (
                <TableRow key={idx}>
                  <TableCell>{p[0]}</TableCell>
                  <TableCell>{p[1]}</TableCell>
                  <TableCell>{p[2]}</TableCell>
                  <TableCell>{p[3]}</TableCell>
                  <TableCell>{p[4]}</TableCell>
                  <TableCell>{p[5]}</TableCell>
                  <TableCell>{p[6]}</TableCell>
                  <TableCell>{p[7]}</TableCell>
                  <TableCell>{p[8]}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Box>
  );
}

export default ProductosPage;
